import React, { Component } from "react";
import style from "./Second.module.css";
class Second extends Component {
  render() {
    return (
      <div id={style.second}>
        <h2>The power of Premium</h2>
        <div id={style.powers}>
          <div>
            <i class="fa-solid fa-comment-slash"></i>{" "}
            <>Ad-free music listening.</>
            <p>Enjoy Uninterrupted music.</p>
          </div>
          <div>
            <i className="fa-solid fa-music"></i> 
            <>Offline playback.</>
            <p>Save your data by listening offline.</p>
          </div>
          <div>
            <i class="fa-solid fa-house-laptop"></i>{" "}
            <>Play everywhere.</>
            <p>Listen on your speakers, TVs and other favorite devices</p>
          </div>
          <div>
            <i className="fa-solid fa-circle-play"></i>
            <>Pay your way.</>
            <p>Prepay with PayTM, UPI and more.</p>
          </div>
        </div>
      </div>
    );
  }
}

export default Second;
